      SELECT DISTINCT + CAST ( 56 AS REAL ) / + col2 + col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + col1 < NULL OR 95 / + ( - col2 * CAST ( NULL AS INTEGER ) ) - ( col1 ) * - 65 IS NOT NULL;
  - name: tab0

outputs:
  - name: q8286.out
    data: |
